        <section className="task-page">
            <h3>My Tasks</h3>
            <hr />

            <div className="container">
                <div className="col-lg-12">
                    <InputText
                        type="text"
                        placeholder="type in your task"
                        omChange={handleCahange}
                        label="Type in your task:"
                    />
                </div>
            </div>
        </section>
    );
}

export default Task;
